import React from "react";
import Collapsible from "react-collapsible";

// style
import "./CollapsibleGroup.css";

const CollapsibleGroup = () => {
  return (
    <div className="parent_div">
      <div className="container">
        <div className="row">
          {/* Left section */}
          <div className="col-md-6 d-flex justify-content-center img-div">
            <img src="./assets/img/coll-img.png" />
          </div>

          {/* Right section */}
          <div className="col-md-6 d-flex justify-content-center flex-col">
            <h4>Our Value</h4>
            <h3>Value We Give To You.</h3>
            <p>
              Property Management Systems or Hotel Operating System, under
              business, terms may be used in real estate, manufacturing,
              logistics, intellectual property, government, or hospitality
              accommodation management.
            </p>
            <Collapsible trigger="What is PMS?">
              <p>
                Property Management Systems or Hotel Operating System, under
                business, terms may be used in real estate, manufacturing,
                logistics, intellectual property, government, or hospitality
                accommodation management.
              </p>
            </Collapsible>
          </div>
        </div>
      </div>
    </div>
  );
};

export default CollapsibleGroup;
